class Solution {
public:
    int maxNonOverlapping(vector<int>& nums, int target) {
        // Dynamic Programming, prefix, Greedy; 1 pass-through
        int sum=0, count=0;
        unordered_set<int> prefix_sum={0};
        for( int i=0; i<nums.size(); i++){
            sum+=nums[i];
            unordered_set<int>::iterator it=prefix_sum.find(sum-target);
            if(it!=prefix_sum.end()){
                count++;
                sum=0;
                prefix_sum={0};
            }else{
                prefix_sum.emplace(sum);// corner case:[1,-1] 0
            }
        }
        return count;
    }
};